// App.js
import React, { useState, useEffect } from "react";
import TreeEditor from "./TreeEditor";
import TreeView from "./TreeView";
import GraphView from "./GraphView";
import UploadButton from "./UploadButton";
import DownloadButtons from "./DownloadButtons";
import { parseTree } from "./utils/parseTree";
import { generateHTML } from "./utils/generateHTML";
import "./App.css";

const App = () => {
  const [treeText, setTreeText] = useState("");
  const [treeData, setTreeData] = useState([]);           // full parsed tree (array)
  const [focusedNode, setFocusedNode] = useState(null);   // node object when focused
  const [leftPct, setLeftPct] = useState(40);
  const draggingRef = useRef(false);
  // Parse text -> tree
  useEffect(() => {
    try {
      const parsed = parseTree(treeText) || [];
      setTreeData(parsed);
    } catch (err) {
      console.error("Error parsing tree:", err);
      setTreeData([]);
    }
  }, [treeText]);

  // File + editor handlers
  const handleFileLoad = (text) => setTreeText(text);
  const handleTextChange = (text) => setTreeText(text);

  // Focus handlers
  const handleFocus = (node) => setFocusedNode(node);
  const handleUnfocus = () => setFocusedNode(null);

  // What to render (focused sub-tree vs full tree)
  const displayedTree = focusedNode ? [focusedNode] : treeData;

  // Downloads
  const handleDownloadHTML = () => {
    // Use full tree for HTML export (keeps the whole doc); change to displayedTree if you want export to respect focus
    const html = generateHTML(treeData);
    const blob = new Blob([html], { type: "text/html" });
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "family_tree.html";
    a.click();
    URL.revokeObjectURL(url);
  };

  const handleDownloadJSON = () => {
    const json = JSON.stringify(treeData, null, 2);
    const blob = new Blob([json], { type: "application/json" });
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "family_tree.json";
    a.click();
    URL.revokeObjectURL(url);
  };

  const handleDownloadSVG = () => {
    // Assumes GraphView sets id="graph-svg" on the <svg>. No-op if not present.
    const svgEl = document.getElementById("graph-svg");
    if (!svgEl) {
      console.warn("SVG element not found for download.");
      return;
    }
    const serializer = new XMLSerializer();
    const source = serializer.serializeToString(svgEl);
    const blob = new Blob([source], { type: "image/svg+xml" });
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "family_tree.svg";
    a.click();
    URL.revokeObjectURL(url);
  };

  return (
    <div className="app-container" style={{ padding: "1rem" }}>
      {/* Header / toolbar */}
  <div className="top-bar">
    <UploadButton onLoad={handleFileLoad} />
    <button onClick={handleDownloadHTML}>Download HTML</button>
    <button onClick={handleDownloadSVG}>Download SVG</button>
    <button onClick={handleDownloadJSON}>Download JSON</button>
    {focusedNode && (
      <button onClick={handleUnfocus}>Unfocus</button>
    )}
  </div>

  {/* Two-pane editor + tree */}
  <div className="two-pane">
    <div className="pane left" style={{ width: `${leftPct}%` }}>
      <h3>Tree Text Editor</h3>
      <textarea
        value={treeText}
        onChange={handleTextChange}
        placeholder="Paste or edit tree text here..."
      />
    </div>
    <div
      className="gutter"
      role="separator"
      onMouseDown={startDrag}
    />
    <div className="pane right">
      <TreeView
        tree={displayedTree}
        onFocus={handleFocus}
        onUnfocus={handleUnfocus}
        focusedNodeId={focusedNode ? focusedNode.id : null}
      />
    </div>
  </div>

      {/* Bottom: SVG view */}
      <div style={{ marginTop: 16 }}>
        <GraphView tree={displayedTree} />
      </div>
    </div>
  );
};

export default App;
